{"title":"MAP APIDS","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega/v5.json
  config: {
    kibana: {type: "map", latitude: 0, longitude: 0, zoom: 2}
  }
  data: [
    {
      name: table
      url: {
        index: waf-1.0-*
        %context%: true
        %timefield%: @timestamp
        body: {
          size: 0
          aggs: {
            gridSplit: {
              geotile_grid: {field: "geoip.location", precision: 4, size: 10000}
              aggs: {
                gridCentroid: {
                  geo_centroid: {
                    field: "geoip.location"
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.gridSplit.buckets"}
      transform: [
        {
          type: geopoint
          projection: projection
          fields: [
            gridCentroid.location.lon
            gridCentroid.location.lat
          ]
        }
      ]
    }
  ]
  scales: [
    {
      name: gridSize
      type: linear
      domain: {data: "table", field: "doc_count"}
      range: [
        50
        1000
      ]
    }
  ]
  marks: [
    {
      name: gridMarker
      type: symbol
      from: {data: "table"}
      encode: {
        enter: {
          fill: {value: "ORANGE"}
        }
        update: {
          size: {scale: "gridSize", field: "doc_count"}
          xc: {signal: "datum.x"}
          yc: {signal: "datum.y"}
        }
      }
    },
    {
      name: gridLabel
      type: text
      from: {data: "table"}
      encode: {
        enter: {
          fill: {value: "black"}
          text: {signal: "datum.doc_count"}
        }
        update: {
          x: {signal: "datum.x"}
          y: {signal: "datum.y"}
          dx: {value: -5}
          dy: {value: -5}
          fontSize: {value: 10}
          fontWeight: {value: "bold"}
        }
      }
    }
  ]
}"}}
